Lepo je i kada se druzis sa ljudima ali onima koji ti odgovaraju.
Dobro je kada si sa sobom na ti i kada nista ne moras.
Dobro je kada je tvoje drustvo takvo da mozes da ostanes svoj i da te takvog prihvataju ili vole.
Najlepse je od svega kada imas nekoga za koga vredi ziveti i kada ti vise ne moras ni da budes ti, vec njihov sluga a oni tvoji gospodari koji te vole jer si ti ti i jer ne treba da budes neko drugi.
